import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const login = () => {
  return (
    <body style={{ margin: "0px" }}>
      <Box>
        <Box
          style={{
            marginLeft: "400px",
            marginRight: "400px",
            height: "600px",
            background: "#F2F3F7",
          }}
        >
          <Typography
            style={{
              marginTop: "20px",
              paddingTop: "10px",
              textAlign: "center",
              fontSize: "30px",

            }}
          >
            Register
          </Typography>
          <Typography style={{textAlign:"center",paddingTop:"10px",color:"#B19B9A"}}>
            Create your account. It's free and only takes a minute.
          </Typography>
        </Box>
      </Box>
    </body>
  );
};
export default login;
